  \"fort-niobrara-national-wildlife-refuge-narrative-report-january-1-to-april-30-1959\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fort Niobrara
  National Wildlife Refuge outlines Refuge accomplishments from January through April
  of 1959. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  fish, reptiles, and disease- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, collections and receipts, and
  vegetation control. Resource management is outlined; topics include grazing and
  haying. A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, hunting, and violations. Items of interest, photographs, newspaper
  articles, and N-R forms are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
